public class Solution {
    public long IncremovableSubarrayCount(int[] nums) {
        long count = 0;
        for (int i = 0; i < nums.Length; i++) {
            for (int j = i; j < nums.Length; j++) {
                if (IsIncremovable(nums, i, j)) count++;
            }
        }
        return count;
    }

    private bool IsIncremovable(int[] nums, int start, int end) {
        bool leftIncreasing = start == 0 || nums[start - 1] < nums[start];
        bool rightIncreasing = end == nums.Length - 1 || nums[end] < nums[end + 1];
        if (!leftIncreasing || !rightIncreasing) return false;

        for (int i = start + 1; i <= end; i++) {
            if (nums[i - 1] >= nums[i]) return false;
        }
        return true;
    }
}
